          "id": "4ed04625a58c5b672b8b507fe045110af7d7189e",
          "message": "feat!: Add client version to ENR (#14352)\n\nCloses #14124\n\nThe client version is added to the ENR. The alternative was to add it to\nthe `Status` message, but as the team suggested, I decided on this\napproach.\n\n### Implementation details\nThe client version is injected into `discV5_service` instead of simply\ncalling `getPackageVersion()` in the service constructor. The reason\nbehind this is simple: it seemed more correct to do it this way in case\nthere is any change in versioning logic in the future. This way, we\nensure that the caller of the P2P service and the P2P service always\nhave the same version.\n\n### Bugfixes\nThere was a small bug in `getPackageVersion()`, resulting in the object\nbeing returned (`{\".\" : \"0.8.6\"}`} instead of string (version), the PR\nalso fixes this.\n\n### Refactoring\nThe ENR generation is extracted into the already existing `generate-enr`\nand follows the logic of ENR generation for the bootstrap nodes.\n\n### Bootstrap nodes\nI deliberately omitted the client version from bootstrap nodes ENR and\ndid not change the bootstrap node's ENR with each version change, as\nthis seems counterproductive and counterintuitive.\n\nThe alternative was for Bootstrap nodes to either have a hardcoded\nversion (e.g., `0` or `0.0.0`) or follow alternative versioning (e.g.,\n`boot-v1`). However, this also seemed like a worse idea because handling\nboot node versions would require special logic and, if not handled\ncorrectly, could cause confusion when displaying this data.\n\n---------\n\nCo-authored-by: Alex Gherghisan <alexghr@users.noreply.github.com>",
